$(document).ready(function(){
  $("#rated").rating();

  $('.rating').click(function(){
    var user_id = $(this).attr('data-user-id');
    var stars = $(this).attr('value');

    $.ajax({
      type: 'post',
      url: '/users/' + user_id + '/rate',
      data: {rating: stars}
    }); 
  })
})
